  downloadNEncode() {
    // console.log("download")
    const fileTransfer: FileTransferObject = this.transfer.create();
    var url = encodeURI(this.imageURL);

    fileTransfer.download(url, this.storageDirectory + "/" + "articleimage.png").then((entry) => {
      // this.common.dismissDownloading();
      // console.log(entry)
      // this.ImageUrl = this.storageDirectory+"/"+"articleimage.png";

      if (this.platform.is('ios')) {
        this.file.readAsDataURL(this.storageDirectory, "articleimage.png").then(dataurl => {
          this.imageURL = dataurl;
        },
          (error) => {
            console.log("file dataurl err", error);
          });
      }
      else if (this.platform.is('android')) {
        this.base64.encodeFile(this.storageDirectory + "/" + "articleimage.png").then((base64File: string) => {
          // console.log(base64File);
          this.imageURL = base64File;
        }, (err) => {
          console.log(err);
        });
      }

    }).catch(err_2 => {
      console.log(err_2)
    });
  }

  goToQuiz() {
    this.navCtrl.push('QuizQuestionsPage')
  }

  likeDislikeArticle(value) {
    if (this.likeFlag == null || (this.likeFlag == true && value == 0) || (this.likeFlag == false && value == 1)) {
      this.isLike = value;
      this.submitCommentRatingLikeDislike('like');

      if(value == 1) {
        this.setUpshotLikeEvent('Like');
      }
      else {
        this.setUpshotLikeEvent('Dislike');
      }
    }
  }

  commentRateArticle() {
    if (this.userComment == "" && this.userRating == 0) {
      return;
    }
    this.submitCommentRatingLikeDislike('comment');

    if(this.userComment) {
      this.setUpshotOtherEvent('Comments')
    }

    if(this.userRating) {
      this.setUpshotOtherEvent('Ratings')
    }
  }

  submitCommentRatingLikeDislike(type) {
    let request = {
      "CustId": this.restapiProvider.userData['CustomerID'],
      "TokenId": this.restapiProvider.userData['tokenId'],
      "ArticleId": this.articleID,
      "LangId": localStorage.getItem('langId'),
      "LikeFlag": this.isLike == null ? "" : this.isLike,
      "UserComment": (type == 'like' ? this.commentFlag : this.userComment) || "",
      "UserRating": (type == 'like' ? this.rateFlag : this.userRating) || "",
      "Status": ""
      // "UpdateFlag": (this.likeFlag == null && this.rateFlag == null && this.commentFlag == null) ? "I" : "U"
    }
    // console.log(request);
    this.restapiProvider.sendRestApiRequest(request, 'SaveUserComment').subscribe((response) => {
      // console.log(response)
      if (response.IsSuccess == true) {
        if (response.Data.Table[0].Status == "Success") {
          if (type == 'comment' && this.commentFlag == null && this.userComment != "") {
            this.isCommentPopup = true;
          }
          this.getArticleLikeCount();
        }
      }
    },
      (error) => {
        console.log(error)
      })
  }

  getUsersComment() {
    let request = {
      "CustId": this.restapiProvider.userData['CustomerID'],
      "TokenId": this.restapiProvider.userData['tokenId'],
      "ArticleId": this.articleID,
      "LangId": localStorage.getItem('langId')
    }
    // console.log(request);
    this.restapiProvider.sendRestApiRequest(request, 'ArticleComments').subscribe((response) => {
      if (response.IsSuccess == true) {
        if (response.Data.Table.length) {
          this.commentsList = response.Data.Table;
          if (this.commentsList.length > 5) {
            this.commentListCopy = this.commentsList.slice(0, 5);
          }
          else {
            this.commentListCopy = this.commentsList;
          }
        }
      }
    },
      (error) => {
        console.log(error)
      })
  }

  setRating(value) {
    if (value == this.userRating) {
      this.userRating = 0;
    }
    else {
      this.userRating = value;
    }
  }

  viewAllComments() {
    this.commentListCopy = this.commentsList;
  }

  getArticleLikeCount() {
    let request = {
      "CustId": this.restapiProvider.userData['CustomerID'],
      "TokenId": this.restapiProvider.userData['tokenId'],
      "ArticleId": this.articleID
    }
    // console.log(request)
    this.restapiProvider.sendRestApiRequest(request, 'ArticleDetails').subscribe((response) => {
      // console.log(response);
      this.pageLoader = false;
      if (response.IsSuccess == true) {
        this.likeFlag = response.Data.Table[0].UserLikeFlag;
        this.rateFlag = response.Data.Table[0].UserRateFlag;
        this.commentFlag = response.Data.Table[0].UserCommentFlag;
        this.isLike = this.likeFlag == null ? null : (this.likeFlag == true ? 1 : 0);

        this.totalLikes = response.Data.Table[0].LikeCount;
        this.totalDislikes = response.Data.Table[0].DislikeCount;
        this.avgRating = response.Data.Table[0].Avg_Rating;

        this.getUsersComment();
      }
    }, (error) => {
      console.log(error)
    })
  }

  hideCommentPopup() {
    this.isCommentPopup = false;
  }

  getName(value) {
    if (value) {
      var arr = value.split(" ");

      if (arr.length > 1) {
        value = (arr[0].slice(0, 1) + arr[1].slice(0, 1)).toUpperCase();
      }
      else {
        value = (arr[0].slice(0, 1)).toUpperCase();
      }
    }
    else {
      value = "A"
    }
    return value;
  }

