  setUpshotShareArticleEvent() {
    let payload = {
      "Appuid": this.utilitiesProvider.upshotUserData.appUId,
      "Language": this.utilitiesProvider.upshotUserData.lang,
      "City": this.utilitiesProvider.upshotUserData.city,
      "AgeGroup": this.utilitiesProvider.upshotUserData.ageGroup,
      "ArticleName": this.article.Title,
      "ArticleCategory": this.tagName
    }
    
    this.utilitiesProvider.upshotCustomEvent('ArticleShare', payload, false);
  }

  setUpshotReadEvent() {
    let payload = {
      "Appuid": this.utilitiesProvider.upshotUserData.appUId,
      "Language": this.utilitiesProvider.upshotUserData.lang,
      "City": this.utilitiesProvider.upshotUserData.city,
      "AgeGroup": this.utilitiesProvider.upshotUserData.ageGroup,
      "DrivenFrom": this.navParams.get('fromPage') || '',
      "ArticleName": this.article.Title,
      "ArticleCategory": this.tagName
    }
    
    this.utilitiesProvider.upshotCustomEvent('ReadArticles', payload, false);
  }

  setUpshotScrollEvent() {
    if(this.isScroll) {
      this.isScroll = false;
      let payload = {
        "Appuid": this.utilitiesProvider.upshotUserData.appUId,
        "Language": this.utilitiesProvider.upshotUserData.lang,
        "City": this.utilitiesProvider.upshotUserData.city,
        "AgeGroup": this.utilitiesProvider.upshotUserData.ageGroup,
        "ArticleName": this.article.Title,
        "ArticleCategory": this.tagName
      }
      console.log(payload)
      this.utilitiesProvider.upshotCustomEvent('ArticleScroll', payload, false);
    }
  }

  setUpshotLikeEvent(action) {
    let payload = {
      "Appuid": this.utilitiesProvider.upshotUserData.appUId,
      "Language": this.utilitiesProvider.upshotUserData.lang,
      "City": this.utilitiesProvider.upshotUserData.city,
      "AgeGroup": this.utilitiesProvider.upshotUserData.ageGroup,
      "ArticleName": this.article.Title,
      "ArticleCategory": this.tagName,
      "Action": action
    }
    console.log(payload)
    this.utilitiesProvider.upshotCustomEvent('LikeDislike', payload, false);
  }

  setUpshotOtherEvent(eventName) {
    let payload = {
      "Appuid": this.utilitiesProvider.upshotUserData.appUId,
      "Language": this.utilitiesProvider.upshotUserData.lang,
      "City": this.utilitiesProvider.upshotUserData.city,
      "AgeGroup": this.utilitiesProvider.upshotUserData.ageGroup,
      "ArticleName": this.article.Title,
      "ArticleCategory": this.tagName
    }
    console.log(payload)
    this.utilitiesProvider.upshotCustomEvent(eventName, payload, false);
  }

  setUpshotTimeSpentEvent() {
    let time = (this.exitTime - this.enterTime) / 1000
    // console.log((this.exitTime - this.enterTime) / 1000)
    let payload = {
      "Appuid": this.utilitiesProvider.upshotUserData.appUId,
      "Language": this.utilitiesProvider.upshotUserData.lang,
      "City": this.utilitiesProvider.upshotUserData.city,
      "AgeGroup": this.utilitiesProvider.upshotUserData.ageGroup,
      "ArticleName": this.article.Title,
      "ArticleCategory": this.tagName,
      "TimeSpent": time > 0 ? Math.round(time) : 0
    }
    console.log(payload)
    this.utilitiesProvider.upshotCustomEvent("ArticleTimeSpent", payload, false);
  }

